[Form]
public class SalesOrderArchiveDetailsForm extends FormRun
{
    #ISOCountryRegionCodes

    private InventDimCtrl_Frm_Mov inventDimFormSetup;

}

[Hookable(false)]
public Common docCursor()
{
    Common docCursor = super();

    if (docCursor.TableId == tableNum(InventDim))
    {
        docCursor = salesLine;
    }

    return docCursor;
}

[Hookable(false)]
public void init()
{
    super();

    // <GEERU>
    if (! SysCountryRegionCode::isLegalEntityInCountryRegion([ #isoRU ]))
    {
        salesLine_ds.object(fieldNum(SalesLine, ProjId)).visible(false);
    }
    // </GEERU>

    #SysSystemDefinedButtons
    FormCommandButtonControl attachButton= this.control(this.controlId(#SystemDefinedAttachButton)) as FormCommandButtonControl;
    attachButton.visible(false);

    element.updateDesign(InventDimFormDesignUpdate::Init);
}

[Hookable(false)]
public void setCaptionText()
{
    element.design().caption(strFmt("@SYS344024", salesTable.SalesId, salesTable.SalesName, salesLine.itemName()));
}

private void buildTMPRecords()
{
    FormDataSource salesTableHistoryList_ds = FormDataUtil::getFormDataSource(element.args().record());

    if (salesTableHistoryList_ds)
    {
        SalesTable salesTableTmp;
        salesTableTmp.recordLevelSecurity(true);
        salesTableTmp.setTmp();

        SalesLine salesLineTmp;
        salesLineTmp.recordLevelSecurity(true);
        salesLineTmp.setTmp();

        SalesLineForeignTradeCategory salesLineForeignTradeCategoryTmp;
        salesLineForeignTradeCategoryTmp.recordLevelSecurity(true);
        salesLineForeignTradeCategoryTmp.setTmp();

        List salesTableHistoryList = new List(Types::Record);

        SalesTableHistory salesTableHistory;

        for (salesTableHistory = salesTableHistoryList_ds.getFirst(true) ?
                                 salesTableHistoryList_ds.getFirst(true) :
                                 salesTableHistoryList_ds.cursor()       ; salesTableHistory; salesTableHistory = salesTableHistoryList_ds.getNext())
        {
            salesTableHistoryList.addEnd(salesTableHistory.data());
        }

        if (salesTableHistoryList.elements() > 0)
        {
            SalesOrderArchiveDetailsFormInteraction archiveDetailsFormInteraction = SalesOrderArchiveDetailsFormInteraction::construct();
            archiveDetailsFormInteraction.buildTMPRecords(salesTableHistoryList.pack());

            salesTableTmp = archiveDetailsFormInteraction.parmSalesTableTmp();
            salesTable.setTmp();
            salesTable.setTmpData(salesTableTmp);

            salesLineTmp = archiveDetailsFormInteraction.parmSalesLineTmp();
            salesLine.setTmp();
            salesLine.setTmpData(salesLineTmp);

            // <GEEPL>
            TaxServiceTariff taxServiceTariffTmp;
            boolean isPL = SysCountryRegionCode::isLegalEntityInCountryRegion([#isoPL]);

            if (isPL)
            {
                taxServiceTariffTmp.recordLevelSecurity(true);
                taxServiceTariffTmp.setTmp();

                taxServiceTariffTmp = archiveDetailsFormInteraction.parmTaxServiceTariff();

                taxServiceTariffHeader.setTmp();
                taxServiceTariffHeader.setTmpData(taxServiceTariffTmp);

                taxServiceTariffLine.setTmp();
                taxServiceTariffLine.setTmpData(taxServiceTariffTmp);
            }
            // </GEEPL>

            salesLineForeignTradeCategoryTmp = archiveDetailsFormInteraction.parmSalesLineForeignTradeCategoryTmp();
            salesLineForeignTradeCategory.setTmp();
            salesLineForeignTradeCategory.setTmpData(salesLineForeignTradeCategoryTmp);
        }
    }
}

[Hookable(false)]
internal void updateDesign(InventDimFormDesignUpdate _mode)
{
    InventMovement movement = InventMovement::construct(salesLine);

    switch (_mode)
    {
        case InventDimFormDesignUpdate::Init :
            if (!inventDimFormSetup)
            {
                inventDimFormSetup = InventDimCtrl_Frm_Mov::newFromFormMovement(element, movement);
            }

        case InventDimFormDesignUpdate::Active :
            inventDimFormSetup.formActiveSetup(movement.inventDimGroupSetup(), movement);
            inventDimFormSetup.formSetControls(true);
            break;

        case InventDimFormDesignUpdate::FieldChange :
            inventDimFormSetup.formActiveSetup(movement.inventDimGroupSetup(), movement);
            inventDimFormSetup.formSetControls(false);
            break;

        default : throw error(strFmt("@SYS54195",funcName()));
    }
}

[Hookable(false)]
public void init()
