{
    super();
    salesLine.recordLevelSecurity(true);
    salesLine.setTmp();
}

[Hookable(false)]
public void linkActive()
{
    super();

    if (!salesLine)
    {
        element.setCaptionText();
    }
}

[Hookable(false)]
public int active()
{
    int ret = super();

    /* Set caption */
    element.setCaptionText();

    return ret;
}

[Hookable(false)]
public void write()
{
    if (SysCountryRegionCode::isLegalEntityInCountryRegion([#isoRU]) && salesTable_RU.SalesTable != 0)
    {
        // no-op because a record with an empty FK is not valid
        super();
    }
}

[Hookable(false)]
public void init()
{
    if (SysCountryRegionCode::isLegalEntityInCountryRegion([#isoRU]))
    {
        this.linkType(FormLinkType::OuterJoin);
    }

    super();
}

[Hookable(false)]
public void clicked()
{
    container journalsExist = salesTable.existingJournals();

    menuCustQuotationJournal.enabled(conPeek(journalsExist, SalesTableType::posQuotation()));
    menuCustConfirmJournal.enabled(conPeek(journalsExist, SalesTableType::posConfirmation()));
    menuInventPickingListJournal.enabled(conPeek(journalsExist, SalesTableType::posPickingList()));
    menuCustPckSlpJournal.enabled(conPeek(journalsExist, SalesTableType::posPackingSlip()));
    menuCustInvoiceJournal.enabled(conPeek(journalsExist, SalesTableType::posInvoice()));

    super();
}

[Hookable(false)]
public void lookup()
{
    InventTable::lookupBOMId(this, salesLine.ItemId, inventDim);
}

[Hookable(false)]
public void lookup()
{
    InventTable::lookupRouteId(this, salesLine.ItemId, inventDim);
}
